Diagnosis. Disc of pronotum smooth, polished, with small punctures in apical 1 / 4 , black. Elytra black, disc glabrous, striae largely effaced; apex laterally punctate ( Figs. 5 , 14 ). Rostral canal subglabrous. Aedeagus (
Figs. 45–46
) apically converging with sinuate sides. Transfer apparatus in dorsal view at middle strongly constricted.

Description. Holotype , male. Length. Pronotum + elytra: 4.2 mm . Color. Antenna, rostrum and tarsi ferruginous; remainder entirely black. Habitus subovate, in dorsal view almost without constriction between pronotum and elytra (
Fig. 5
); profile dorsally with shallow constriction between pronotum and elytron (
Fig. 14
).
